import React from "react";
import logo from "./logo.svg";
import "./styles/coreStyles/App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import Navbar from "./components/navbar";
import { Provider } from "react-redux";
import TitleSlider from "./components/titleSlider";
import { Container } from "react-bootstrap";
import ScheduleElement from "./components/scheduleElement";
import { ITitleElement } from "./Interfaceses/ITitleElement";
import TitleList from "./components/titleList";
function App() {
  const test: ITitleElement = {
    id: 12,
    name: "TestAnime",
    posterUrl: "test.jpg",
    seriesNum: 99,
    releaseTime: new Date(12, 12, 12, 12, 12, 12),
  };
  return (
    <React.Fragment>
      <Navbar />
      <Container>
        <h2>
          <a>Сейчас на экранах</a>
        </h2>
        <TitleSlider />
        <ScheduleElement scheduleElement={test} />
        <TitleList listName={"test"} />
      </Container>
    </React.Fragment>
  );
}

export default App;
